               <label>{this.props.lieuMission}</label>
               <label>{this.props.client}</label>
            <h2>Etendue de la mission</h2>
               <label>{this.props.etendue}</label>
            <h2>Logistiques</h2>
               <label>{this.props.materiels}</label>
               <label>{this.props.lieu}</label>
               <label>{this.props.mobilisation}</label>
               <label>{this.props.logement}</label>
